import React from 'react'

function Projects() {
  return (
    <div className="projects-container">
      <div className='paypro-container'>PayPro</div>
      <div className='petder-container'>Petder Better</div>
      <div className='lunchbox-container'>LunchBox</div>
      <div className='declustor-container'>DeClustor</div>
      <div className='jiggly-container'>JigglyDex</div>
      <div className='nextflick-container'>NextFlick</div>
    </div>
  )
}

export default Projects;
